import React, { useEffect, useState } from 'react';
import Card from './Card';
import Navbar from './Navbar';
import FileUpload from './FileUpload';
import supabase from './supabaseClient';

export default function Catalog({ user, setUser, csvData, setCsvData }) {
    const [cards, setCards] = useState([]);
    const [product, setProduct] = useState({
        product_url: "",
        product_title: "",
        price_available: "",	
        currency: "",	
        price: "",	
        brand: "",	
        image: "",	
        description: "",	
        quantity: "",	
        users: "",	
        additional_description: "",	
        additional_images: "",
    })

    function handleChange(event) {
        const { name, value } = event.target;
        setProduct(prevFormData => ({
            ...prevFormData,
            [name]: value
        }));
    }

    useEffect(() => {
        async function fetchUserData() {
            const { data, error } = await supabase
                .from('user_data')
                .select('*')
                .eq('email', user);

            if (error) {
                console.error('Error fetching data:', error);
            } else {
                setCards(data.map(obj => <Card key={obj.id} obj={obj} />));
            }
        }
            if(user){
            fetchUserData();}
    },[]);

    console.log(user)

    const handleFileParsed = async (data) => {
        const userData = data.map(item => ({ ...item, email: user }));
        const { error } = await supabase
            .from('user_data')
            .insert(userData);

        if (error) {
            console.error('Error inserting data:', error);
        } else {
            setCards(userData.map(obj => <Card key={obj.id} obj={obj} />));
        }
    };


    return (
        <div>
            <Navbar setUser={setUser} />
            <div className='set-catalog'>
                <h2>Product Information</h2>
                <input type='text'></input>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="product_url"
                            value={product.product_url}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="product_title"
                            value={product.product_title}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="price_available"
                            value={product.price_available}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="currency"
                            value={product.currency}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="price"
                            value={product.price}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="brand"
                            value={product.brand}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="image"
                            value={product.image}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="description"
                            value={product.description}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="quantity"
                            value={product.quantity}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="users"
                            value={product.users}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="additional_description"
                            value={product.additional_description}
                        />
                </label>
                <label>
                        <span>Name</span>
                        <input
                            type="text"
                            onChange={handleChange}
                            name="name"
                            value={product.add}
                        />
                </label>
            </div>
            <FileUpload setCards={setCards} user={user} />
            <div className="card-grid">
                {cards}
            </div>
        </div>
    );
}

